x_dot(1:3) = p_dot;
fprintf('x_dot_46 \n')
x_dot(4:6) = 1/m_ges*(f_ext + f - c_11*p_dot - c_12*omega - c_13*theta_dot); % - m_ges*g*[0 0 1]' <-- gravitation terms are set to zero
fprintf('x_dot_79 \n')
x_dot(7:9) = T\omega;
fprintf('x_dot_1012 \n')
x_dot(10:12) = inv(m_22)*(t_ext + t - c_21*p_dot - c_22*omega - c_23*theta_dot); %  - g_2 <-- gravitation terms are set to zero
fprintf('x_dot_1315 \n')
x_dot(13:15) = theta_dot;
fprintf('x_dot_1618 \n')
x_dot(16:18) = inv(m_33)*(t_man_ext + t_man - c_31*p_dot - c_32*omega - c_33*theta_dot); % - g_3 <-- gravitation terms are set to zero
fprintf('x_dot_1936 \n')
x_dot(19:36) = 0;
x_dot = x_dot';

fprintf('y_13 \n')
y(1:3) = p;
fprintf('y_46 \n')
y(4:6) = 1/m_ges*(f_ext + f - c_11*p_dot - c_12*omega - c_13*theta_dot); %  - m_ges*g*[0 0 1]' <-- gravitation terms are set to zero
fprintf('y_79 \n')
y(7:9) = eul_angl;
fprintf('y_1012 \n')
y(10:12) = omega;
fprintf('y_1315 \n')
y(13:15) = theta;
fprintf('y_1618 \n')
y(16:18) = inv(m_33)*(t_man_ext + t_man - c_31*p_dot - c_32*omega - c_33*theta_dot); % - g_3 <-- gravitation terms are set to zero
y(19:21) = f;
y(22:24) = t;
y(25:27) = t_man;
y = y';

%% linearization
    % delta_x_dot = A*delta_x
    % delta_y = C*delta_x
fprintf('Linearization \n')
for i=1:size(x_dot)
    for j=1:size(x)
        A(i,j) = diff(x_dot(i),x(j));
    end
end
for i=1:size(y)
    for j=1:size(x)
        C(i,j) = diff(y(i),x(j));
    end
end
% substitute linearisation point
zero = 0.00001;
fprintf('simplify A \n')
A = subs(A,{phi,the,psi,theta1,theta2,theta3},{0.1,0.1,0.1,pi/3,pi/3,pi/3});
A = subs(A,{px_dot,py_dot,pz_dot,omegax,omegay,omegaz,theta1_dot,theta2_dot,theta3_dot},{zero,zero,zero,zero,zero,zero,zero,zero,zero});
A = subs(A,{fx,fy,fz,tx,ty,tz,t1_man,t2_man,t3_man},{zero,zero,48.0690,zero,zero,zero,zero,zero,zero});
A = subs(A,{fx_ext,fy_ext,fz_ext,tx_ext,ty_ext,tz_ext,t1_man_ext,t2_man_ext,t3_man_ext},{zero,zero,zero,zero,zero,zero,zero,zero,zero});

fprintf('simplify C \n')
C = subs(C,{phi,the,psi,theta1,theta2,theta3},{0.1,0.1,0.1,pi/3,pi/3,pi/3});
C = subs(C,{px_dot,py_dot,pz_dot,omegax,omegay,omegaz,theta1_dot,theta2_dot,theta3_dot},{zero,zero,zero,zero,zero,zero,zero,zero,zero});
C = subs(C,{fx,fy,fz,tx,ty,tz,t1_man,t2_man,t3_man},{zero,zero,48.0690,zero,zero,zero,zero,zero,zero});
C = subs(C,{fx_ext,fy_ext,fz_ext,tx_ext,ty_ext,tz_ext,t1_man_ext,t2_man_ext,t3_man_ext},{zero,zero,zero,zero,zero,zero,zero,zero,zero});
%% discretization 
    % x_k_1 = F*x_k + H*u_k
    % y_k_1 = C*x_k
fprintf('Discretization \n')    
% forward Euler method
F = eye(size(A)) + T_dis*A;
% fourth-order Runge-Kutta method
% F = eye(size(A)) + T_dis*A + T_dis^2/2*A^2 + T_dis^3/6*A^3 + T_dis^4/24*A^4;

%% substitute variables with values
fprintf('substitute F \n')
F = subs(F, {m,m_l1,m_l2,m_l3,g}, {3.9,0.3,0.35,0.35,9.81});
F = subs(F, {alpha1,alpha2,alpha3,},{pi/2,0,0});
F = subs(F, {d1,d2,d3},{0.1,0,0});
F = subs(F, {a1,a2,a3},{0,0.3,0.3});
fprintf('substitute C \n')
C = subs(C, {m,m_l1,m_l2,m_l3,g}, {3.9,0.3,0.35,0.35,9.81});
C = subs(C, {alpha1,alpha2,alpha3,},{pi/2,0,0});
C = subs(C, {d1,d2,d3},{0.1,0,0});
C = subs(C, {a1,a2,a3},{0,0.3,0.3});

%% save F, H and C in .txt files
fprintf('save \n')
file1 = 'F.txt';
file2 = 'C.txt';

fileID = fopen(file1,'w')
fprintf(fileID,'F = [ \t');
[row_F,col_F] = size(F);
for i= 1:row_F
    for j= 1:col_F
        if j < col_F
            fprintf(fileID,'%s, \t',char(F(i,j)));
        else
            fprintf(fileID,'%s',char(F(i,j)));
        end
    end
    if i < row_F
        fprintf(fileID,'; \n\t\t');
    else
        fprintf(fileID,']; \n');
    end
end
fclose(fileID);

